import React from 'react';
import {XYPlot, XAxis, YAxis, HorizontalGridLines, LineSeries, FlexibleWidthXYPlot, Candlestick} from 'react-vis';

export default class QuestionOne extends React.Component {
    render () {
        return (
            <div className="candlestick-example">
            <div className="chart">
              <FlexibleWidthXYPlot animation yDomain={[0, 100]} height={300}>
                <XAxis />
                <YAxis />
                <LineSeries color="#12939A" data={data} />
                <LineSeries
                  color="#FF9833"
                  className="dashed-example-line"
                  data={[{x: 0, y: 25}, {x: 30, y: 25}]}
                />
                <LineSeries
                  color="#1A3177"
                  className="dashed-example-line"
                  opacity={0.3}
                  data={[{x: 0, y: 75}, {x: 30, y: 75}]}
                />
                <Candlestick
                  colorType="literal"
                  opacityType="literal"
                  stroke="#79C7E3"
                  data={data}
                />
              </FlexibleWidthXYPlot>
            </div>
          </div>
        )
    }
}
